  "source": "pragma solidity ^0.6.0;\r\n\r\n// taken straight from the Solidity docs\r\n// https://solidity.readthedocs.io/en/v0.5.10/solidity-by-example.html?highlight=auction#id2\r\n// you must modify this to be compatible with the MartianMarket contract\r\ncontract MartianAuction {\r\n    // Parameters of the auction. Times are either\r\n    // absolute unix timestamps (seconds since 1970-01-01)\r\n    // or time periods in seconds.\r\n    address deployer;\r\n    address payable public beneficiary;\r\n\r\n    // Current state of the auction.\r\n    address public highestBidder;\r\n    uint public highestBid;\r\n\r\n    // Allowed withdrawals of previous bids\r\n    mapping(address => uint) public pendingReturns;\r\n\r\n    function getPendingReturns(address _adress) public view returns (uint){\r\n        return pendingReturns[_adress];\r\n    }\r\n\r\n    // Set to true at the end, disallows any change.\r\n    // By default initialized to `false`.\r\n    bool public ended;\r\n\r\n    // Events that will be emitted on changes.\r\n    event HighestBidIncreased(address bidder, uint amount);\r\n    event AuctionEnded(address winner, uint amount);\r\n\r\n    // The following is a so-called natspec comment,\r\n    // recognizable by the three slashes.\r\n    // It will be shown when the user is asked to\r\n    // confirm a transaction.\r\n\r\n    /// Create a simple auction with `_biddingTime`\r\n    /// seconds bidding time on behalf of the\r\n    /// beneficiary address `_beneficiary`.\r\n    constructor(\r\n        address payable _beneficiary\r\n    ) public {\r\n        deployer = msg.sender;\r\n        beneficiary = _beneficiary;\r\n    }\r\n\r\n    /// Bid on the auction with the value sent\r\n    /// together with this transaction.\r\n    /// The value will only be refunded if the\r\n    /// auction is not won.\r\n    function bid(address payable sender) public payable {\r\n        // No arguments are necessary, all\r\n        // information is already part of\r\n        // the transaction. The keyword payable\r\n        // is required for the function to\r\n        // be able to receive Ether.\r\n\r\n        \r\n        // If the bid is not higher, send the\r\n        // money back.\r\n        require(\r\n            msg.value > highestBid,\r\n            \"There already is a higher bid.\"\r\n        );\r\n\r\n        if (highestBid != 0) {\r\n            // Sending back the money by simply using\r\n            // highestBidder.send(highestBid) is a security risk\r\n            // because it could execute an untrusted contract.\r\n            // It is always safer to let the recipients\r\n            // withdraw their money themselves.\r\n            pendingReturns[highestBidder] += highestBid;\r\n        }\r\n        highestBidder = sender;\r\n        highestBid = msg.value;\r\n        emit HighestBidIncreased(sender, msg.value);\r\n    }\r\n\r\n    /// Withdraw a bid that was overbid.\r\n    function withdraw() public returns (bool) {\r\n        uint amount = pendingReturns[msg.sender];\r\n        if (amount > 0) {\r\n            // It is important to set this to zero because the recipient\r\n            // can call this function again as part of the receiving call\r\n            // before `send` returns.\r\n            pendingReturns[msg.sender] = 0;\r\n\r\n            if (!msg.sender.send(amount)) {\r\n                // No need to call throw here, just reset the amount owing\r\n                pendingReturns[msg.sender] = amount;\r\n                return false;\r\n            }\r\n        }\r\n        return true;\r\n    }\r\n\r\n    /// End the auction and send the highest bid\r\n    /// to the beneficiary.\r\n    function auctionEnd() public {\r\n        // It is a good guideline to structure functions that interact\r\n        // with other contracts (i.e. they call functions or send Ether)\r\n        // into three phases:\r\n        // 1. checking conditions\r\n        // 2. performing actions (potentially changing conditions)\r\n        // 3. interacting with other contracts\r\n        // If these phases are mixed up, the other contract could call\r\n        // back into the current contract and modify the state or cause\r\n        // effects (ether payout) to be performed multiple times.\r\n        // If functions called internally include interaction with external\r\n        // contracts, they also have to be considered interaction with\r\n        // external contracts.\r\n\r\n        // 1. Conditions        \r\n        require(!ended, \"auctionEnd has already been called.\");\r\n        require(msg.sender == deployer, \"You are not the auction deployer!\");\r\n\r\n        // 2. Effects\r\n        ended = true;\r\n        emit AuctionEnded(highestBidder, highestBid);\r\n\r\n        // 3. Interaction\r\n        beneficiary.transfer(highestBid);\r\n    }\r\n}\r\n",
